import Shorts from "./shorts";
import Home from "./home";
import Detail from "./detail";
import Aside from "../widget/aside";
import React from "react";
import ExceptPage from "./except";
import { Routes, Route, useNavigate } from "react-router-dom";

const Page = (props) => {
  const navigate = useNavigate();
  const pageChangeEvent = (page) => {
    navigate(`/${page.toLowerCase()}`);
  };
  return (
    <>
      <Aside onPageClick={pageChangeEvent} />
      <Routes>
        <Route
          path="/"
          element={<Home darkMode onPageClick={pageChangeEvent} />}
        />
        <Route path="/shorts" element={<Shorts />} />
        <Route path="/detail" element={<Detail darkMode />} />
        <Route
          path="/subscribe"
          element={<ExceptPage dark={props.darkModeState} />}
        />
        <Route
          path="/youtubeMusic"
          element={<ExceptPage dark={props.darkModeState} />}
        />
        <Route
          path="/myVideo"
          element={<ExceptPage dark={props.darkModeState} />}
        />
        <Route
          path="/offline"
          element={<ExceptPage dark={props.darkModeState} />}
        />
      </Routes>
    </>
  );
};
export default Page;
